BEGIN;

CREATE TABLE report_output(
                              row BIGINT
                                  NOT NULL
                                  CHECK (
                                      row > 0
                                      ),

                              main_uploaded_variation TEXT
                                  NOT NULL,

                              main_existing_variation TEXT
                                  NOT NULL,

                              main_symbol TEXT
                                  NOT NULL,

                              main_af_vcf NUMERIC
                                  NOT NULL,

                              main_dp NUMERIC
                                  NOT NULL,

                              details2_provean TEXT
                                  NOT NULL,

                              details2_dann_score NUMERIC
                                  NULL,

                              links_mondo TEXT
                                  NOT NULL,

                              links_pheno_pubmed TEXT
                                  NOT NULL,

                              PRIMARY KEY
                                  (row)
) WITHOUT OIDS;

CREATE INDEX ON report_output(main_uploaded_variation);
CREATE INDEX ON report_output(main_existing_variation);
CREATE INDEX ON report_output(main_symbol);
CREATE INDEX ON report_output(main_af_vcf);
CREATE INDEX ON report_output(main_dp);
CREATE INDEX ON report_output(details2_dann_score);

